var title_f11_26_11692="Criteria substance dependence";
var content_f11_26_11692=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F50295&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F50295&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    DSM-IV-TR criteria for substance dependence",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        A maladaptive pattern of substance use, leading to clinically significant impairment or distress, as manifested by three (or more) of the following, occurring at any time in the same 12-month period:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Tolerance, as defined by either of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        A need for markedly increased amounts of the substance to achieve intoxication or desired effect",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Markedly diminished effect with continued use of the same amount of the substance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Withdrawal, as manifested by any of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        The characteristic withdrawal syndrome for the substance (refer to Criteria A and B of the criteria sets for Withdrawal from the specific substances)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        The same (or a closely related) substance is taken to relieve or avoid withdrawal symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        The substance is often taken in larger amounts or over a longer period than was intended",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        There is a persistent desire or unsuccessful efforts to cut down or control substance use",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        A great deal of time is spent in activities necessary to obtain the substance (eg, visiting multiple doctors or driving long distances), use the substance (eg, chain-smoking), or recover from its effects",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Important social, occupational, or recreational activities are given up or reduced because of substance use",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        The substance use is continued despite knowledge of having a persistent or recurrent physical or psychological problem that is likely to have been caused or exacerbated by the substance (eg, current cocaine use despite recognition of cocaine-induced depression, or continued drinking despite recognition that an ulcer was made worse by alcohol consumption)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from the Diagnostic and Statistical Manual of Mental Disorders, Text Revision, Fourth Edition. Copyright &copy; 2000 American Psychiatric Association.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
